pragma solidity ^0.5.0;

contract AddressService {
   string driverid;
   string oldadd;
   string newadd;

function setAddressChange(string memory _driverid, string memory _oldadd,string memory _newadd) public {
      driverid = _driverid;
      oldadd= _oldadd;
      newadd = _newadd;
      
   }
   
   function getAddressChange() public view returns (string memory,string memory,string memory) {
       return ( driverid,oldadd,newadd);
   
   }
    
}
